import { useEffect, useState } from 'react';
import '../App.css';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

import { Checkbox } from "primereact/checkbox";
import { Button } from 'primereact/button';

import { SideBarAdmin } from './SideBar';

export function ReceiptTable(){

    const [ticket,setTicket]=useState()
    const [ticketState,setTicketState]=useState()



    useEffect(()=>{
    fetch("http://localhost:8080/ticket",{
        method:"GET"
    })
    .then((res=>res.json()))
    .then((data)=>{

        const {content}=data


        setTicket(content)


    })


    },[])
    useEffect(()=>{


        const handleButtonClick = (ticketId) => {
            // Handle button click for the specific ticket
            console.log(`Button clicked for ticket ID: ${ticketId}`);
        };

    },[])


    console.log(ticket.map(value=>{{state=value}}))
    return(
        <>
        <div className="card">
            <SideBarAdmin/>
            <DataTable value={ticket} 
            paginator rows={5} 
            rowsPerPageOptions={[5, 10, 25, 50]} 
            tableStyle={{ minWidth: '50rem' }}
            className='card-table'>
            <Column field="id" header="Code" />
                <Column field="user.firstName" header="First Name"/>
                <Column field="user.lastName" header=" Name"/>
                <Column field="user.department" header="Departament"/>
                <Column body={(ticket) => 
                <div>
                    <Checkbox checked={ticket.ticketState} />
                    {!ticket.ticketState && <Button onClick={() => handleButtonClick(ticket.id)} label="Receipt" className='button' />}

                </div>}
                header="Ticket State"/>

            </DataTable>
        </div>



        </>)

    }
